import React, { Component } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";

import HomeWork1 from "./hw1/HomeWork1";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route exact path="/hw1" component={HomeWork1} />
        </Switch>
      </BrowserRouter>
    );
  }
}
export default App;
